        let bInc      = 0;
        let moveTime  = 0;
        let movesToGo = 0;
        let depth     = 0;
        let nodes     = 0;
        
        var i = 1;
        while (i < tokens.length) {
          switch (tokens[i]) {
            case 'depth': {
              depth = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'nodes': {
              nodes = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'movesToGo': {
              movesToGo = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'moveTime': {
              moveTime = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'wInc': {
              wInc = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'bInc': {
              bInc = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'wTime': {
              wTime = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            case 'bTime': {
              bTime = parseInt(tokens[i+1]);
              i += 2;
              break;
            }
            default: {
              console.log('unknown go token', tokens[i]);
              i++;
            }
          }
        }
        
        if (depth)
          timing.targetDepth = depth
        else
          timing.targetDepth = MAX_PLY;
        
        if (nodes)
          timing.targetNodes = nodes
        else
          timing.targetNodes = MAX_INT;
        
        if (moveTime > 0)
          timing.finishTime = Date.now() + moveTime + slop;
        
        else {
        
          if (movesToGo)
            movesToGo += 2;
          else
            movesToGo = 30;
        
          if (wTime && s.turn == WHITE)
            timing.finishTime = Date.now() + 0.95 * (wTime/movesToGo + wInc) + slop;
          else if (bTime && s.turn == BLACK)
            timing.finishTime = Date.now() + 0.95 * (bTime/movesToGo + bInc) + slop;
        }
        
        go();
        
